import React from 'react'
import './styles.css'
import NavbarTop from '../../assets/img/navbar.svg'

export default function Navbar() {
  return (
    <nav>
      <div className="nav-bar">
        <img src={NavbarTop} alt=""/>
      </div>
    </nav>
  )
}
